它的特色是从物种间的角度来讨论蜘蛛/网在不同文化中的作用的论文，以及一个专门用于Matera作品的颜色图像的部分。 摘自Saraceno的简介： “我一直对蜘蛛/网完全着迷。部分在意大利流放中长大，也许是他们能够在任何地方和他们随身携带的材料，内部，如此迷人的材料造成家园的能力。他们的网络经常被用作宇宙和近地生活网之间的类比，并在我的内心倾斜的一百次累积。地球上的生活。 因此，恐惧症对我来说也一直是一个巨大的谜。有人怎么会害怕这个小巧，令人难以置信的复杂存在？这些问题使我走上了与像我这样的其他人和文化的途径 - 在全球范围内以及整个时间都有很多人 - 谁不讨厌蜘蛛，而是尊重他们 - 在某些情况下，甚至崇拜他们。” &gt;
